import Api from '@/utils/Api';

export function createPNUser(data){
    Api.addPNUser(data)
        .then(res => {
            if(res){
                alert("Your Subscription is updated with user Id"+res.userId)
            }
        })
        .catch(err => {
            console.log("error is here",err)
        });
};
